ull solve () {
	sll i, j, ki, li;
	ull result = 0;
	// sll result = 0;
	double dresult = 0;
	// ull maybe = 0;
	sll maybe = 0;
	// ull sum = 0;
	sll sum = 0;
	sll item;
	ull *dpcell;

	for (i = 1; i <= n; i++) {
		rev[i * (i - 1) / 2] = i;
	}

	qsort(xy, n, sizeof(hwll), phwllABcomp);

	ki = 0;
	for (i = 0; i < n; i++) {
		for (j = i + 1; j < n; j++) {
			sll x1 = xy[i].a, y1 = xy[i].b, x2 = xy[j].a, y2 = xy[j].b;
			linell l = {
				{y2 - y1, x2 - x1},
				{y1 * x2 - y2 * x1, x2 - x1}
			};
			// printf("%lld %lld %lld %lld ->\t", l.a.a, l.a.b, l.b.a, l.b.b);

			if (x1 == x2) {
				l.a.a = 1;
				l.b.a = x1;
			} else {
				sll g;
				g = gcd((ull)sdiff(l.a.a, 0), l.a.b);
				// printf("(g1 %lld) ", g);
				l.a.a /= g;
				l.a.b /= g;
				g = gcd((ull)sdiff(l.b.a, 0), l.b.b);
				// printf("(g2 %lld) ", g);
				l.b.a /= g;
				l.b.b /= g;
			}

			lines[ki++] = l;
			// printf("%lld %lld %lld %lld\n", l.a.a, l.a.b, l.b.a, l.b.b);
		}
	}
	fflush(stdout);
	qsort(lines, ki, sizeof(linell), pquadcomp);

	result = (bitpow(2, n, FOD) + FOD - 1 - n) % FOD;

	i = 0;
	while (i < ki) {
		j = i;
		while (i < ki && !pquadcomp(lines + i, lines + j)) i++;

		ull x = rev[i - j];
		result = (result + FOD - bitpow(2, x, FOD) + 1 + x) % FOD;
	}

	printf("%lld\n", result);
	// printf("%.15lf\n", dresult);
	// puts(s);

	return 0;

	success:
	// puts("YES");
	puts("Yes");
	// printf("%llu\n", result);
	// puts("0");
	// puts("Yay!");
	return 0;

	fail:
	// puts("NO");
	puts("No");
	// puts("0");
	// puts("-1");
	// puts("-1 -1 -1");
	// puts("Impossible");
	return 1;
}
